import React from 'react';

class Zerodha extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="container">
                <div className="text-center">
                    <img src="https://zerodha.com/static/images/landing.png"></img>
                    <h1 className="display-4 font-bold">Invest in everything</h1>
                </div>

            </div>
        )
    }
}


export default Zerodha
